import logo from './logo.svg';
import './App.css';

import DopComponent from './defaultComponents'
import {
  BrowserRouter as Router,
  Route,
  Link,
  Switch
} from 'react-router-dom';


export default function App() {
  return (
    <Router>
      <div>
        <ul>
          <li>
            <Link to="/dop">DOP</Link>
          </li>
        </ul>

        <Switch>
          <Route  component= {zDopComponent } path="/dop">
            <DopComponent />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}
